webpackJsonp([0xd33f47cc2c1c5800],{"./node_modules/json-loader/index.js!./.cache/json/javascript-location-reload-method.json":function(e,o){e.exports={data:{markdownRemark:{html:'<h2>Location Reload Method</h2>\n<p>The “Location” reload method is a method on the “Location” object. By default it is implemented on the <code>window</code> object. It can be used to reload your current web page.</p>\n<p>It takes an optional boolean parameter. When set to <code>true</code>, the page will reload from the server. When unset, or set to <code>false</code>, the page may be reloaded from cache, depending on the browser. </p>\n<h3>Example:</h3>\n<div class="gatsby-highlight">\n      <pre class="language-javascript"><code>location<span class="token punctuation">.</span><span class="token function">reload</span><span class="token punctuation">(</span><span class="token boolean">true</span><span class="token punctuation">)</span><span class="token punctuation">;</span>\n</code></pre>\n      </div>\n<p>This will reload the page at the current URL from the server.</p>\n<h4>More Information:</h4>\n<ul>\n<li><a href="https://developer.mozilla.org/docs/Web/API/Location/reload">MDN</a></li>\n</ul>',fields:{slug:"/javascript/location-reload-method/"},frontmatter:{title:"Location Reload Method"}}},pathContext:{slug:"/javascript/location-reload-method/"}}}});
